DROP TRIGGER IF EXISTS `newaddress`;
delimiter ;;
CREATE TRIGGER `newaddress` BEFORE INSERT ON `addressee` FOR EACH ROW begin
	declare id varchar(10);
	set id=(select AddressID from addressee order by cast(AddressID as UNSIGNED INTEGER) desc limit 1);
	if(select AddressID from addressee order by cast(AddressID as UNSIGNED INTEGER) desc limit 1) is null then
		set new.AddressID="1";
	else set new.AddressID=id+1;
	end if;

end
;;
delimiter ;

