DROP TRIGGER IF EXISTS `newarcID`;
delimiter ;;
CREATE TRIGGER `newarcID` BEFORE INSERT ON `archives` FOR EACH ROW begin
	if(select archivesID from archives where BID=new.BID order by cast(archivesID as UNSIGNED INTEGER) desc limit 1)is not null then
	set new.archivesID=(select archivesID from archives  order by cast(archivesID as UNSIGNED INTEGER) desc limit 1)+1;
	end if;
end
;;
delimiter ;

